import React from 'react';

const Home = () => {
    return (
        <div style={{ marginTop: '50px', padding: '0 50px', textAlign: 'center' }}>
            <h2 style={{ fontSize: '36px' }}>Welcome to Gourmet Guidebook</h2>
            <p style={{ fontSize: '24px', textAlign: 'justify' }}>This is the home page of the Recipe Manager application. You can use this application to manage your recipes and categories.</p>
            <p style={{ fontSize: '20px', textAlign: 'justify' }}>Get started by navigating to the Recipes or Categories page using the navigation links above.</p>
        </div>
    );
};

export default Home;
